import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export const store = new Vuex.Store({
  state: {
    ab: 5,
    cd: 7
  },
  getters: {
  },
  mutations: {
    plus(state){
      this.$store.state.ab++

    }
  },
  actions: {
  },
  modules: {
  }
})
